import React, {useState, useEffect} from 'react';
import { Routes, Route } from 'react-router-dom';

import NavBar from './NavBar';
import HeroList from './HeroList';

function App() {


  return (
  <>
    <NavBar/>
      <Routes>
        <Route exact path = '/' element={<HeroList/>}/>

      </Routes>

  </>
  )
}

export default App;
